import data from "./exampleresponse.json"
import Singlevideo from "./SingleVideo"

const Youtube=()=>{
    return (
      <>
{data.map(video=>{
         return <Singlevideo key={video.id} {...video} />
    })}
        </>
    )
   
}


export default Youtube;
